import LinkedInIcon from '@mui/icons-material/LinkedIn';
import WhatsAppIcon from '@mui/icons-material/WhatsApp';
import './Footer.css';

const Footer = () => {
  return (
    <div className='footer'>
      <div className='social-icons'>
        {/* LinkedIn Icon with Link */}
        <a href="https://www.linkedin.com/company/your-company-name" target="_blank" rel="noopener noreferrer">
          <LinkedInIcon className='icon' />
        </a>

        {/* Naukri Icon with Link */}
        <a href="https://www.naukri.com/" target="_blank" rel="noopener noreferrer">
          <img src="path_to_your_naukri_icon_image" alt="Naukri" className='icon' />
        </a>

        {/* WhatsApp Icon with Link */}
        <a href="https://wa.me/your-whatsapp-number" target="_blank" rel="noopener noreferrer">
          <WhatsAppIcon className='icon' />
        </a>
      </div>

      <p>Â© 2024 All Rights Reserved</p>
    </div>
  );
};

export default Footer;
